import React from 'react';

class Femi extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            isLogIn: false
        }
        this.handleClick = this.handleClick.bind(this)
    }
    
    render(){
        return(
            <div>
                <button type="button">LoGIN</button>
            </div>
        )
    }
}


export default Femi
